  \"Evaluation of the 100 meter protective zone for bald eagle nests in southeast
  Alaska\",\n\t\"tracking_summary\": {\n\t\t\"total\": 9,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:28.376997\",\n\t\"name\":
  \"evaluation-of-the-100-meter-protective-zone-for-bald-eagle-nests-in-southeast-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bald eagle (Haliaeetus leucocephalus) nests
  in southeast Alaska have been protected by a 100 m buffer zone since 1968. Nests
  near logging developments were surveyed before and after logging had occurred. The
  average length of time between cessation of logging and the nest resurvey was 5
  years. After logging had ceased, nest activity rates were not reduced compared to
  unlogged areas. The probability of nest destruction by wind was significantly increased
  when clear-cut logging was within 45 m of the nest tree. Blowdown timber was found
  adjacent to 42% of the clear-cut areas in the vicinity of eagle nests. If blowdown
  associated with logging had occurred within the 100 m protective buffer zone, an
  average 30% of the zone contained blowdown. The 100 m nest buffer zones may be inadequate
  for providing nesting and perching habitat, indefinitely, in the face of adjacent
  sustained yield clear-cut logging practices. Management of the entire coastal beach
  fringe forest in old growth status is recommended.\",\n\t\"license_title\": \"License
